import styled from "styled-components"

export default function TelaLogin({icon}){
    return(
        <Icon>
        <img src={icon} alt="icon" />
        </Icon>

    )
}

const Icon = styled.div`
    display: flex;
    justify-content: center;
    background-color: red;
    padding: 134px 0 38px 38px;
`
